def extractor(data):
    try:
        soup = BeautifulSoup(data, "html.parser")
        result = {}
        for inputs in soup.find_all("input"):
            name = inputs.get("name")
            value = inputs.get("value")
            if name:
                result[name] = value
        return result
    except Exception as e:
        return {"error": str(e)}


